const $ =  document.querySelector.bind(document)
const $$ = document.querySelectorAll.bind(document)

const header = $('header h2')
const cd_thumb = $('.cd-thumb')
const audio = $('#audio')
const cd = $('.cd')
const cdwidth = cd.offsetWidth
const player = $('.player')
const playBtn = $('.btn-toggle-play')
const progress = $('#progress')
const btnnext = $('.btn-next')
const btnprev = $('.btn-prev')
// set ở class btn-toggle-play(nút bấm)
const app = {
    isPlaying: false,
    // mặc định khi chưa bấm play
    currentindex : 0,
    songs: [
      {
        name: "Bật Tình Yêu Lên",
        singer: "Hoà Minzy",
        path: "./assset/music/song1.mp3",
        // moá cuối cùng của sửa được, phải tải về xong rồi, bỏ vô bên thư mục kia rồi link qua đây
        image: "https://i.scdn.co/image/ab67616d00001e0213f21c1dc491085ef1347f3d"
      },
      {
        name: "Lạc",
        singer: "Rhymastic",
        path: "./assset/music/song2.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "Something Just Like This",
        singer: "Chainsmokers, Coldplay",
        path:
          "./assset/music/song3.mp3",
        image: "data:image/jpeg;base64,"
      },
      {
        name: "Only Love",
        singer: "TradeMark",
        path: "./assset/music/song4.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "Let Her Go",
        singer: "Passenger",
        path: "./assset/music/song5.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "One Call Way",
        singer: "Charlie Puth",
        path:
          "./assset/music/song6.mp3",
        image:
        "data:image/jpeg;base64,"

      },
      {
        name: "Dacing With Your Ghost",
        singer: "Sasha Sloan",
        path: "./assset/music/song7.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "The Last Goodbye",
        singer: "Billy Boyd",
        path: "./assset/music/song8.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "The Nights",
        singer: "Avicii",
        path: "./assset/music/song9.mp3",
        image:
          "data:image/jpeg;base64,"
      },
      {
        name: "Way Back Home",
        singer: "Shaun",
        path: "./assset/music/song10.mp3",
        image:
          "data:image/jpeg;base64,"
      }
    ],
    render: function(){
        // hàm in ra 
        const htmls = this.songs.map(song => {
            return `
            <div class="song">
            <div class="thumb" style="background-image: url('${song.image}')">
            </div>
            <div class="body">
              <h3 class="title">${song.name}</h3>
              <p class="author">${song.singer}</p>
            </div>
            <div class="option">
              <i class="fas fa-ellipsis-h"></i>
            </div>
          </div>`
        })
        $('.playlist').innerHTML = htmls.join('\n')
    },
    // Animation cho đĩa nhạc
  
    defineproperties: function ()  {
      // tự định nghĩa các thuộc tính
      Object.defineProperty(this,'currentsong', {
       get: function() {
        return this.songs[this.currentindex]
       }
      } )
    },
    // lắng nghe sự kiện
    handleEvents: function(){
        const _this = this

        // animate api 
        const cdth = cd_thumb.animate([{
          transform : 'rotate(360deg)'
        }],{
          duration: 10000,
          iterations: Infinity
        })
        cdth.pause()
        // mới đầu thì cho dừng lại

        document.onscroll = function(){
          // lắng nghe sự kiện kéo
          const scrollTop = window.scrollY || document.documentElement.scrollTop 
          const newcdWidth = cdwidth - scrollTop
          cd.style.width = newcdWidth > 0 ? newcdWidth + 'px' : 0
          cd.style.opacity = newcdWidth/cdwidth
        }

        playBtn.onclick = function(){
          // lăng nghe sự kiện click lên nút bấm
          // ban đầu khi click vào thì câu lệnh sẽ chạy ở dòng else vì đang false
          // sau đó task audio.onplay sẽ thực hiện nghĩa vụ trở về true
          // khi bấm một lần nữa thì true sẽ thực hiênj task pause và cứ thế lặp lại

          // xử lí trạng thái 
          if (_this.isPlaying){
            audio.pause();
            // _this.isPlaying = false;
            // player.classList.remove('playing');
          }
          else{
            audio.play();
            // _this.isPlaying = true;
            // player.classList.add('playing');
          }
     
        }
        // khi audio được bật
          audio.onplay = function(){
            _this.isPlaying = true;
            player.classList.add('playing');
            cdth.play()
          }
        // khi audio bị pause
          audio.onpause = function(){
            _this.isPlaying = false;
            player.classList.remove('playing');
            cdth.pause()
          }

        // khi bài hát chạy và thanh thời gian bên dưới chạy theo
          audio.ontimeupdate = function(){
            // kiếm tra xem nếu duration ko phải là NaN thì thực hiện các bước bên dưới
           if (audio.duration){
            const percentprogress = Math.floor(audio.currentTime / audio.duration * 100)
            // currentTime là thời gian hiện tại 
            // duration là chiều dài thời gian của bài hát
            // tính toán được chiều dài hiện tại thanh ngang có thể chạy
            progress.value = percentprogress
           }
          }
          // khi tua tới một đoạn bất kì, onchange trên thể progress
          progress.onchange = function(e){
            // truy cập đến thẻ progress sau đo lắng nghe sự kiện change thì value sẽ thay đổi
            // sau đó ta cập nhật audio.currentTime ở thời điểm bị change
            audio.currentTime = e.target.value / 100 * audio.duration ;  
            // bởi vì property currentTime có thể set thời gian bất kì nên khi set thì thanh ngang của
            // thẻ progress sẽ thay đổi theo
          }

          // next song
          btnnext.onclick = function(){
              _this.nextSong()
              audio.play()
          }

          btnprev.onclick = function(){
            _this.prevSong() 
            audio.play()
          }
        
        
    },

    // tải bài hát hiện tại
    loadCurrentSong: function () {
      header.textContent = this.currentsong.name
      cd_thumb.style.backgroundImage = `url('${this.currentsong.image}')`
      // lúc này thì audio đã được cập nhật
      audio.src= this.currentsong.path
    },
    
    nextSong: function(){
      this.currentindex++
      if (this.currentindex >= this.songs.length ){
        this.currentindex = 0
      }
      this.loadCurrentSong()
    },

    // prevSong:
    prevSong: function(){
      this.currentindex--
      if (this.currentindex <= 0 ){
        this.currentindex = this.songs.length - 1
      }
      this.loadCurrentSong()
    },
    start: function(){

        // Tự định nghĩa các thuộc tính
        this.defineproperties();

        // Tải bài hát đầu tiên
        this.loadCurrentSong();

        // Lắng nghe các sự kiện
        this.handleEvents();
      
        // In ra màn hình playlist
        this.render();
    }
}
app.start()

